<!DOCTYPE html>

<style>
body {
    font-family: "Courier New", Courier, monospace;
    background: #f5eded;
}
.program-name {
    text-align: center;
}
.grid-container {
  background-color: #3e3636;
  display: grid;
grid-template-columns: repeat(44, auto);

  grid-auto-rows: 1fr;
  padding: 8px;
}

.invis-boi {
    /* border: 1px solid rgba(0, 0, 0, 0.1); */
    width: 0%;
    padding-bottom: 100%;
}
.grid-item {
    position: relative;
    background-color: rgba(255, 255, 255, 0.8);
    /* border: 1px solid rgba(0, 0, 0, 0.1); */
    width: 100%;
    padding-top: 100%;
}
.text {
    position: absolute;
    top: -25%;
    padding-top: 50%;
    height: 100%;
    width: 100%;
    font-size: 1vw; /*have to find a good value for this*/
    text-align: center;
    color: black;
    background: none;
    border: none;
    resize: none;
    user-select: none;
}

.sp {
  background-color: #d72323;
  grid-column: 1;
  grid-row: 1;
  font-size: 8px;
  text-align: center;
  z-index: 10;
  transition: 1s;
  margin-right: -0%;
  margin-left: 0%;
  margin-top: 0%;
  margin-bottom: -0%;
  border-radius: 10%;
}
.output-container {
    text-align: center;
}
.output {
  content: "-";
  white-space: pre;
}
